        "Spring Data JPA","Spring Data Mongodb",
        "Spring MVC","MySQL","Microservices Architecture",
        "REST API","Apache Kafka","Git","Git Hub"
    ]
    const [Skills,setSkills]=useState()
  return (
    <div className='Skills'>
        <marquee>
        <div className='Skill-Container'>
        {Skills.map(skill=>(
            <div>{skill}</div>
        ))}
    </div>
    </marquee>
    </div>
  )
}
